import styled from "styled-components";
import { ReactComponent as cardbutton } from "../../assets/cardbutton.svg";

export const ButtonDiv = styled.div`
  width: 200px;
  height: 50px;
`;

export const Dots = styled(cardbutton)`
  position: absolute;
  top: 2%;
  left: 86%;
`;
